import React from "react";
import { View, Text, Input, Button } from "react-native";
export default function Login() {
  return (
    <View>
      <Text>Login</Text>
      <Text>Username or primary email</Text>
      {/* <Input></Input> */}
      <Text>Password</Text>
      {/* <Input></Input> */}
      {/* <Button>Forgot your password?</Button> */}

      <Text>Remember me</Text>
    </View>
  );
}
